  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(255) NOT NULL COMMENT '类型',
  `name` varchar(255) NOT NULL COMMENT '字段描述',
  `value` varchar(255) DEFAULT '' COMMENT '字段值',
